اب ہر کوئی اصل خبر سےیا سش سےآگاہ نہیں ہوتا.
اور جھوٹی خبرکا بہت برا ردعمل دیکھا ہےمیں...مگر یہاں قانون بس قانون ہیں اور بےشمار ہیں.

@AsifIqbalccw جو قوم اپنی زندگی کے لیے ڈاکٹر یاسمین راشد کی بات نہیں سنتی۔ وہ یہ فیک نیوز والی کیا بات سنے گی۔
اس کا حل ۔۔۔۔۔
اوپر کے ٹاپ لیول کے جھوٹوں کو پکڑ کر سزا دی جائے

@AsifIqbalccw بھائی صاحب اپکے ادارے سے بچپن سے پالا پڑا ہے
ائیر پورٹ والی FIA ہو یا سائبر کرائم والی لینڈ لائن فون پے سروس دینے کے لئے پورے ہاکستان سے بندہ نہیں ملا آپ لوگوں کو آج تک!!!
باقی لاہور کی شکایت پہ کراچی والے کیا کرتے ہونگے آپ خود اندازہ لگا لیں
